import "./register.scss";
import { Link } from "react-router-dom";

const Register = () => {
   return (
      <div className="register">
         <div className="card">
            <div className="left">
               <h1>UltraGo</h1>
               <p>Everything is out of reach until you reach it.</p>
               <span>Do you have an account?</span>
               <Link to="/login">
                  <button>Login</button>
               </Link>
            </div>
            <div className="right">
               <h1>Register</h1>
               <form>
                  <input
                     type="text"
                     placeholder="Username"
                     name="username"
                     //   onChange={handleChange}
                  />
                  <input
                     type="email"
                     placeholder="Email"
                     name="email"
                     //   onChange={handleChange}
                  />
                  <input
                     type="password"
                     placeholder="Password"
                     name="password"
                     //   onChange={handleChange}
                  />
                  <input
                     type="text"
                     placeholder="Name"
                     name="name"
                     //   onChange={handleChange}
                  />
                  {/* {err && err} */}
                  <button>Register</button>
               </form>
            </div>
         </div>
      </div>
   );
};

export default Register;
